import React from "react";

const SuperchargeSection = () => {
  return (
    <div className="relative bg-black text-white py-16 px-8 flex flex-col items-center text-center">
      {/* Content Wrapper */}
      <div className="relative z-10 max-w-3xl space-y-6">
        {/* Supercharged Title */}
        <p className="text-pink-300 font-medium text-lg">Supercharged</p>

        {/* Main Headline */}
        <div className="space-y-2">
          <p className="text-4xl font-bold">Up to 3X higher</p>
          <p className="text-4xl font-bold">engagement and conversions</p>
        </div>

        {/* Description */}
        <p className="text-gray-400 text-lg leading-relaxed">
          A whole new way to generate media for your stores. Create images,
          videos, text, ads & 3D that let your customers see your brand in ways
          never before.
        </p>
      </div>

      {/* 3X Center Focus */}
      <div className="relative mt-12">
        <p className="text-9xl font-extrabold text-pink-500 opacity-80">3X</p>
        {/* Background visual text effect */}
        <div className="absolute inset-0 text-gray-500 text-opacity-30 text-center text-sm">
          <p className="transform -translate-y-1/2">more more less human...</p>
        </div>
      </div>
    </div>
  );
};

export default SuperchargeSection;
